    "aquatic-organisms-ds193531a5",nt"isopen": false,nt"url": null,nt"notes":
    "This dataset is a subset of the Tuolumne Aquatic Resources Relational Inventory
    (TARRI) compiled by Brian Quelvog, California Department of Fish and Game. The database
    focuses on fish, amphibians, insects, crustacean, and other invertebrates, and includes
    hydrologic information associated with collection sites in inland waterways located
    in Tuolumne County and the six surrounding counties (Calaveras, Stanislaus, Merced,
    Mariposa, Mono, and Alpine). Over seventy-five sources of information were used
    to develop the dataset including aquatic surveys by several agencies, file reports
    from the California Department of Fish and Game, personal communications, and research
    articles as well as museum records from institutions such as the California Academy
    of Sciences. Collection dates for some data are historical (back to 1889), but the
    majority range from 1979 to 2003. What each record represents Each record represents
    the collection, identification, and cataloging of one or more specimens of the given
    taxon under the location, time, and habitat conditions listed in the record.",nt"license_title":
